import React from 'react'

export function Registro(props) {

    const data = [['Covid 19','Examen Isopado '],['Antiquenos','sadad lkjadslkj']]
    return (
        <div className='container bg-white min-h-screen'>

            <button>Agregar Examen</button> 

            <table>
                <thead>
                    <tr>
                        <th>Examen</th>
                        <th>Descripcion</th>
                    </tr>
                </thead>
                <tbody>
                {
                    data.map(element=>{
                        return(
                            <tr>
                            <th>{element[0]}</th>
                            <th>{element[1]}</th>
                            </tr>
                        )
                    })
                }  
                </tbody> 
            </table>
        </div>
    )
}
